ours Audio playback: Up to 75 hours 20W adapter or higher (sold separately) Fast-charge capable:Up to 50% charge in around 30 minutes with 20W adapter or higher (available separately)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>In the Box</strong></p>\n</td>\n<td>\n<p>iPhone with iOS 16, USB-C to Lightning Cable, Documentation</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>Warranty</strong></p>\n</td>\n<td>\n<p>Apple-branded hardware product and accessories contained in the original packaging (&ldquo;Apple Product&rdquo;) come with a One-Year Limited Warranty. See&nbsp;apple.com/in/legal/warranty&nbsp;for more information.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>Height</strong></p>\n</td>\n<td>\n<p>5.81 inches (147.5 mm)</p>\n</td>\n</tr>\n</tbody>\n</table>\n<table class=\"a-bordered\">\n<tbody>\n<tr>\n<td>\n<p><strong>Width</strong></p>\n</td>\n<td>\n<p>2.81 inches (71.5 mm)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>Depth</strong></p>\n</td>\n<td>\n<p>0.31 inch (7.85 mm)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>Weight</strong></p>\n</td>\n<td>\n<p>7.27 ounces (206 grams)</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<div class=\"a-fixed-left-grid a-spacing-base\">\n<div class=\"a-fixed-left-grid-inner\">\n<div class=\"a-fixed-left-grid-col a-col-right\">\n<div id=\"question-Tx1LLHGS9IK8PRT\" class=\"a-fixed-left-grid a-spacing-small\">\n<div class=\"a-fixed-left-grid-inner\">\n<div class=\"a-fixed-left-grid-col a-col-left\"><span class=\"a-text-bold\">Question:</span></div>\n<div class=\"a-fixed-left-grid-col a-col-right\"><a class=\"a-link-normal\" href=\"https://www.amazon.in/ask/questions/Tx1LLHGS9IK8PRT/ref=ask_dp_dpmw_al_hza\"><span class=\"a-declarative\" data-action=\"ask-log-click-csm\" data-csa-c-type=\"widget\" data-csa-c-func-deps=\"aui-da-ask-log-click-csm\" data-ask-log-click-csm=\"{&quot;metricName&quot;:&quot;ask-btf-top-question-text-click&quot;}\" data-csa-c-id=\"8k7cef-9jvu6k-cc0ftt-lefona\">When i phone 14 pro deep purple will be available</