idirectional signal capsule, it&nbsp;captures broadcast-quality sound from a 360-degree range and delivers it to your recording device via its&nbsp;6m(20&rsquo;) shielded cable. With the&nbsp;improved sensitivity, signal-to-noise and a flat frequency response, BY-M1 allows&nbsp;you to record every last audio detail with lower self-noise.<br>&nbsp;<br><strong>Two Recording Modes For Different Using Scenarios</strong><br>Featuring a&nbsp;3.5mm&nbsp;4-pole&nbsp;TRRS output connector, you&nbsp;can connect BY-M1 to your camera or&nbsp;camcorder under&nbsp;&ldquo;camera&rdquo;&nbsp;mode, and&nbsp;also connect&nbsp;it to your smartphone or&nbsp;PC when switch to&nbsp;&ldquo;OFF/Smartphone&rdquo;&nbsp;mode.<br>&nbsp;<br><strong>Every Necessary Accessory Is Included</strong><br>In terms of accessories, you will find lapel clip, foam windscreen all in pack, and a LR44 battery for using &ldquo;camera&rdquo; mode, &nbsp;a 1/4\" audio adapter for compatible further device, and a carrying pouch to provide secure protection.</p>\n<div><br>&nbsp;</div>\n<div>\n<div><strong>Using the microphone</strong><br>&nbsp;</div>\n<div>&bull; For Smartphone</div>\n<div>&nbsp; Switch off the microphone. Slide the ON/OFF up to OFF/Smartphone</div>\n<div>&nbsp; The power is shut down.</div>\n<div>&bull; For DSLR, Camcorders, Audio recorders, PC ect</div>\n<div>&nbsp; Switch on the microphone. Slide the ON/OFF up to ON</div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div>\n<div><strong>Specifications：</strong></div>\n<div>&nbsp;</div>\n<div>\n<table border=\"1\" cellspacing=\"0\" cellpadding=\"2\">\n<tbody>\n<tr>\n<td>&nbsp;Polar pattern:</td>\n<td>&nbsp;Omini-directional</td>\n</tr>\n<tr>\n<td>&nbsp;Frequency response:</td>\n<td>&nbsp;65Hz-18KHz</td>\n</tr>\n<tr>\n<td>&nbsp;Signal/Noise:</td>\n<td>&nbsp;74dB or more</td>\n</tr>\n<tr>\n<td>&nbsp;Output Impadence:&nbsp;</td>\n<td>&nbsp;1000&Omega; or less</td>\n</tr>\n<tr>\n<td>Power requirement:&nbsp;</td>\n<td>&nbsp; LR44</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</div>\n</div>\n</div>',1100,_binary '',1500,5,_binary '','Boya mic 1025','b28682fc-fb3e-4136-a22a-97ef0a15ea4a.jpg',NULL);
